curl -XPOST 'http://localhost:9200/electronic_products/_create/12886' -H 'Content-Type: application/json' -d '{"product_name": "SGM4518", "table_name": "GENERAL DESCRIPTION", "content": "GENERAL DESCRIPTION  The SGM4518 is an 8-channel, TTL/CMOS compatible  analog multiplexer. It operates from +3.2V to +36V  single power supply or ±3.2V to ±18V dual power  supplies.  The SGM4518 features high voltage, low on-resistance  and low distortion. The high performances make it very  suitable for multiple applications, such as battery-  operated equipment, audio and video signal routing,  etc.  TTL/CMOS logic compatibility can be guaranteed when  using a single +5V or dual ±5V power supplies because  the logic thresholds of all digital inputs are between  0.8V and 2.4V.  The SGM4518 is available in Green SOIC-16, SSOP-16,  TSSOP-16 and TQFN-3×3-16L packages. It operates  over an operating temperature range of -40℃ to +125℃.    "}'
